import React, { Component } from 'react';
import logo from './logo.svg';
import Home from './components/Home'
import Navbar from './components/Navbar'
import './App.css';

class App extends Component {
  render() {
    return (
      <div>
        <Navbar />
        <Home />
      </div>
    );
  }
}

export default App;
